import React from "react";
import SidebarWithHeader from "./SidebarWithHeader";
import {Heading} from "@chakra-ui/react";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import QuizNewPage from "../quiz_new/QuizNewPage";
import Main from "../main/Main";
const Dashboard = () => {
    return (
        <BrowserRouter>
            <Switch>
                <SidebarWithHeader>
                    <Route path={"/admin"} exact>
                        <Main>Content</Main>
                    </Route>
                    <Route path={"/admin/quiz/new"} exact>
                        <QuizNewPage/>
                    </Route>
                    <Route path={"/admin/quiz/:id/edit"}>
                        <Heading>Admin/Quiz/ID:9349389</Heading>
                    </Route>
                </SidebarWithHeader>

            </Switch>
        </BrowserRouter>

    )
};
export default Dashboard;
